import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Slideshow from "./components/Slideshow";
import Home from "./pages/Home";
import About from "./pages/About";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Donation from "./components/Donation";
import DonationPayment from "./components/DonationPayment";
import FoodTracking from "./components/FoodTracking";
import FoodDonation from "./pages/FoodDonation";

function App() {
  return (
    <Router>
      <Navbar />

      <Routes>
        <Route
          path="/"
          element={
            <>
              <Slideshow />
              <Home />
              <About />
              <Donation />
              <section id="money-donation" style={{ textAlign: "center" }}>
                <h2>Money Donation</h2>
                <DonationPayment amount={500} />
              </section>
            </>
          }
        />

        <Route path="/food-donation" element={<FoodDonation />} />
        <Route path="/food-tracking" element={<FoodTracking />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route path="/donate" element={<FoodDonation />} />
      </Routes>

      <footer className="footer">
        <p>¬© 2025 Helping Universe üåç| All Rights Reserved</p>
      </footer>
    </Router>
  );
}

export default App;
